import React from 'react';
import App from './page/App';

function Demo() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="/logo.svg" className="App-logo d-flex" alt="logo" />
        <p>
          da suawr
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default Demo;
